function Friend({friend,index}){
    return(
        <p key={index}>{friend}</p>
)};

function ListFriend({listFriends}) {
    return (
        <>
            {listFriends.map((friend, index)=> {
                return <Friend />
            })}
        </>

)};


export default ListFriend;
